import icon1 from './chevron-left.svg';
import icon2 from './chevron-right.svg';
import icon3 from './chevron-up.svg';
import icon4 from './chevron-down.svg';
import icon5 from './list.svg';
import icon6 from './x-lg.svg';
import icon7 from './person.svg';
import icon8 from './heart.svg';
import icon9 from './geo-alt.svg';
import icon10 from './map.svg';
import icon11 from './card-list.svg'

export const Icons = {
  left: icon1,
  right: icon2,
  up: icon3,
  down: icon4,
  menu: icon5,
  close: icon6,
  user:icon7,
  heart:icon8,
